const shareButttons = document.querySelectorAll('.tile-share-button')

async function copyText(e) {
    //previnir de fazer o default que é ir para o site
    e.preventDefault()
    let link = this.getAttribute('link')
    try {
        await navigator.clipboard.writeText(link)
        alert('copiado para área de transferência ')
    } catch (error) {
        console.log(error);
    }
}


shareButttons.forEach(
    button => button.addEventListener('click', copyText)
)

// Botão de salvar contato no celular
let contato = document.querySelector('.share-button')
function saveContato(e) {
    var contact = {
        name: "Felipe Reis (Icaro Tech)",
        phone: "19 37318310",
        email: "felipe.reis@icarotech.com",
        url: "https://www.linkedin.com/in/felipesdreis/",
        image: base64 //converter imagem para base64 (https://www.base64-image.de/)
    };
    // Criar um arquivo vcard (https://en.wikipedia.org/wiki/VCard)
    var vcard = "BEGIN:VCARD\nVERSION:4.0\nFN:" + contact.name 
    + "\nTEL;TYPE=work,voice:" + contact.phone 
    + "\nEMAIL:" + contact.email 
    + "\nURL:" + contact.url 
    + "\nPHOTO;ENCODING=BASE64;TYPE=JPEG:" + contact.image 
    + "\nEND:VCARD";
    var blob = new Blob([vcard], { type: "text/vcard" });
    var url = URL.createObjectURL(blob);

    const newLink = document.createElement('a');
    newLink.download = contact.name + ".vcf";
    newLink.textContent = contact.name;
    newLink.href = url;

    newLink.click();
}

contato.addEventListener('click', saveContato)


